package org.trs.oa.entity;import javax.persistence.*;import java.io.Serializable;import java.util.Date;/** * The persistent class for the ts_user_enrollment database table. *  */@Entity@Table(name="ts_user_enrollment")@NamedQueries({		@NamedQuery(name = "TsUserEnrollment.findByUserId",query = "select t from TsUserEnrollment t where t.user.id = :userId and t.inactiveInd = 'N'")})public class TsUserEnrollment implements Serializable {	private static final long serialVersionUID = -3174810895217518013L;	@Id	@GeneratedValue(strategy= GenerationType.IDENTITY)	private int id;	@Temporal(TemporalType.TIMESTAMP)	@Column(name="end_date")	private Date endDate;	@Column(name="inactive_ind")	private String inactiveInd = "N";	@Temporal(TemporalType.TIMESTAMP)	@Column(name="start_date")	private Date startDate;	@OneToOne	@JoinColumn(name = "user_id")	private User user;	public TsUserEnrollment() {	}	public int getId() {		return this.id;	}	public void setId(int id) {		this.id = id;	}	public Date getEndDate() {		return this.endDate;	}	public void setEndDate(Date endDate) {		this.endDate = endDate;	}	public String getInactiveInd() {		return this.inactiveInd;	}	public void setInactiveInd(String inactiveInd) {		this.inactiveInd = inactiveInd;	}	public Date getStartDate() {		return this.startDate;	}	public void setStartDate(Date startDate) {		this.startDate = startDate;	}	public User getUser() {		return user;	}	public void setUser(User user) {		this.user = user;	}}